import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  makeStyles,
} from "@material-ui/core";
import { useHistory } from "react-router-dom";

import isAuth, { userType } from "../lib/isAuth";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
  },
}));

const Navbar = (props) => {
  const classes = useStyles();
  let history = useHistory();

  const handleClick = (location) => {
    console.log(location);
    history.push(location);
  };

  return (
    <AppBar position="fixed" background="transparent">
      <Toolbar style={{ minHeight: "80px" }}>
        <Typography
          variant="h6"
          className={classes.title}
          style={{ fontSize: "32px", fontWeight: "800" }}
        >
          <img
            src="https://scontent.fdel3-2.fna.fbcdn.net/v/t39.30808-6/348237432_635961321891094_8493549441674749326_n.jpg?_nc_cat=107&ccb=1-7&_nc_sid=5f2048&_nc_ohc=3sCOTwYUBD0Q7kNvgFjExNZ&_nc_ht=scontent.fdel3-2.fna&oh=00_AYBo34ZQug_0wV5ow6oddBeZ1G4G5Qqj03eqKYTAUVFQ4g&oe=664AD6B9"
            alt=""
            width="30px"
            height="auto"
            marginLeft="5px"
          ></img>
          Mazdoor Rozgar
        </Typography>
        <div style={{ marginTop: "20px" }}>
          {isAuth() ? (
            userType() === "recruiter" ? (
              <>
                <Button color="inherit" onClick={() => handleClick("/home")}>
                  <Typography style={{ fontSize: "18px" }}>Home</Typography>
                </Button>
                <Button color="inherit" onClick={() => handleClick("/addjob")}>
                  <Typography style={{ fontSize: "18px" }}>Add Jobs</Typography>
                </Button>
                <Button color="inherit" onClick={() => handleClick("/myjobs")}>
                  <Typography style={{ fontSize: "18px" }}>Posted</Typography>
                </Button>
                <Button
                  color="inherit"
                  onClick={() => handleClick("/employees")}
                >
                  <Typography style={{ fontSize: "18px" }}>
                    Employees
                  </Typography>
                </Button>
                <Button color="inherit" onClick={() => handleClick("/profile")}>
                  <Typography style={{ fontSize: "18px" }}>Profile</Typography>
                </Button>
                <Button color="inherit" onClick={() => handleClick("/logout")}>
                  <Typography style={{ fontSize: "18px" }}>Logout</Typography>
                </Button>
              </>
            ) : (
              <>
                <Button color="inherit" onClick={() => handleClick("/home")}>
                  <Typography style={{ fontSize: "18px" }}>Home</Typography>
                </Button>
                <Button
                  color="inherit"
                  onClick={() => handleClick("/applications")}
                >
                  <Typography style={{ fontSize: "18px" }}>Applied</Typography>
                </Button>
                <Button color="inherit" onClick={() => handleClick("/profile")}>
                  <Typography style={{ fontSize: "18px" }}>Profile</Typography>
                </Button>
                <Button color="inherit" onClick={() => handleClick("/logout")}>
                  <Typography style={{ fontSize: "18px" }}>Logout</Typography>
                </Button>
              </>
            )
          ) : (
            <>
              <Button color="inherit" onClick={() => handleClick("/login")}>
                <Typography style={{ fontSize: "18px" }}>Login</Typography>
              </Button>
              <Button color="inherit" onClick={() => handleClick("/signup")}>
                <Typography style={{ fontSize: "18px" }}>SignUp</Typography>
              </Button>
            </>
          )}
        </div>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
